import React from 'react';
import Tilt from 'react-tilt';
import brain from './brain.png';
import './Logo.css';

const withTiltRef = (WrappedComponent) => {
  const hoc = React.forwardRef((props, ref) => {
    return (
      <WrappedComponent {...props} innerRef={ref} />
    );
  });

  return hoc;
};

const TiltWithRef = withTiltRef(Tilt);

const Logo = () => {
  const tiltRef = React.useRef(null);

  return (
    <div className="ma4 mt0">
      <TiltWithRef
        className="Tilt br2 shadow-2"
        options={{ max: 55 }}
        style={{ height: 150, width: 150 }}
        innerRef={tiltRef}
      >
        <div className="Tilt-inner pa3">
          <img style={{ padding: '5px' }} src={brain} alt="Logo" />
        </div>
      </TiltWithRef>
    </div>
  );
};

export default Logo;
